/* eslint-disable react/jsx-pascal-case */
import Profile_Pic from "./profile_pic";

const Header = () => {
  return (
    <div id="header">
      <div id="logo-container">
        <div id="logo"></div>
        <div id="name">Wubo</div>
      </div>
      <div id="profile-container">
        <div id="profile-pic"></div>
      </div>
    </div>
  );
};

export default Header;
